import React from "react"; 
import logo from '../Images/logo.png';


const Header=()=>{
    return(
        <>
            <header>
                <div className="container container-flex">
                    <div>
                        <img src={logo} alt="" />
                    </div>
                    <nav>
                        <div className="list">
                            <a href="#">Home</a>
                            <a href="/about">About</a>
                        </div>
                    </nav>
                </div>
            </header>
        </>
    )
}
export default Header;
